import React from "react";
import MapComponent from "./MapComponent";
import "./App.css";

function App() {
  return (
    <div className="App">
      <h1>Trucker Logbook App</h1>
      <MapComponent
        startLocation="New York, NY"
        pickupLocation="Chicago, IL"
        dropoffLocation="Los Angeles, CA"
      />
    </div>
  );
}

export default App;
